<?php

namespace App\Functional\Tests\Controller;


use Symfony\Component\HttpFoundation\File\UploadedFile;

/**
 * Class UploadControllerTest
 * @package App\Functional\Tests\Controller
 */
class UploadControllerTest extends \Symfony\Bundle\FrameworkBundle\Test\WebTestCase
{

    /**
     * @var string
     */
    private $fileTestUrl = 'http://www.adm-mosrentgen.ru/wp-content/uploads/2017/07/%D0%BC%D0%B8%D0%BD%D1%8C%D0%BE%D0%BD%D1%8B-%D0%BF%D1%80%D0%B8%D0%BA%D0%BE%D0%BB%D1%8B-%D0%BA%D0%B0%D1%80%D1%82%D0%B8%D0%BD%D0%BA%D0%B8.jpg';

    /**
     * @var string
     */
    private $fileTestB64 = '';

    /**
     * @var string
     */
    private $fileTestPath = __DIR__.'/resource/testfile.jpg';

    /**
     * empty request
     */
    public function testUploadAction()
    {
        $client = static::createClient();
        $client->request('POST', '/api/upload');
        $data = json_decode($client->getResponse()->getContent(), true);
        $this->assertEquals(200, $client->getResponse()->getStatusCode());
        $this->assertArrayHasKey('uploads', $data);
        $this->assertArrayHasKey('previews', $data);

        $this->assertEmpty($data['uploads']);
        $this->assertEmpty($data['previews']);
    }

    /**
     * empty request
     */
    public function testUploadViaJsonAction()
    {
        $client = static::createClient();
        $client->request(
            'POST',
            '/api/upload',
            [],
            [],
            [],
            json_encode([
                'files' => [
                    $this->fileTestUrl,
                    $this->fileTestB64,
                ],
            ])

        );

        $data = json_decode($client->getResponse()->getContent(), true);
        $this->assertEquals(200, $client->getResponse()->getStatusCode());
        $this->assertArrayHasKey('uploads', $data);
        $this->assertArrayHasKey('previews', $data);
        $this->assertNotEmpty($data['uploads']);
        $this->assertNotEmpty($data['previews']);
        $this->assertCount(2, $data['uploads']);
        $this->assertCount(2, $data['previews']);
    }

    /**
     * empty request
     */
    public function testUploadMultiAction()
    {
        $client = static::createClient();

        //prepare file to send
        $preparedFile = tempnam('/tmp','test');
        copy($this->fileTestPath, $preparedFile);

        $client->request(
            'POST',
            '/api/upload',
            [
                'files' => [
                    $this->fileTestB64,
                    $this->fileTestUrl,
                ],
            ],
            [
                'files' => [
                    new UploadedFile(
                        $preparedFile,
                        'photo.jpg',
                        'image/jpeg',
                        null
                    ),
                ],
            ]
        );

        $data = json_decode($client->getResponse()->getContent(), true);
        $this->assertEquals(200, $client->getResponse()->getStatusCode());
        $this->assertArrayHasKey('uploads', $data);
        $this->assertArrayHasKey('previews', $data);
        $this->assertNotEmpty($data['uploads']);
        $this->assertNotEmpty($data['previews']);
        $this->assertCount(3, $data['uploads']);
        $this->assertCount(3, $data['previews']);
    }
}